 export const  SIDEBAR_DATA = [
    {
    name : 'inbox',
    title:  'Inbox',
    icon : Photo
    },
    {
        name : 'starred',
        title:  'Starred',
        icon : StarOutline
    },
    {
        name : 'sent',
        title:  'Sent',
        icon : AccessTimeOutlined
    }

 ];
